    <title>Reusable Hover Stroke – Every Time + White Overlay</title>
    <style>
      /* ---------- Base path style (your original) ---------- */
      .ikr_svg_container {
        width: 70%;
        height: auto;
        margin: 0 auto;
      }

      .anim-path {
        fill: #4d4da1;
        stroke: #231f20;
        stroke-width: 1;
        stroke-miterlimit: 10;
        cursor: pointer;
        position: relative;
        /* needed for pseudo-element */
      }

      /* ---------- White overlay (background) ---------- */
      .anim-path::before {
        content: "";
        position: absolute;
        inset: 0;
        background: rgba(255, 255, 255, 0.12);
        /* white with 12% opacity */
        pointer-events: none;
        opacity: 0;
        transition: opacity 0.25s ease;
      }

      .anim-path:hover::before {
        opacity: 1;
      }

      /* ---------- Highlight stroke (white, thicker) ---------- */
      .anim-path.highlight {
        stroke: #ffffff;
        stroke-width: var(--stroke-w, 4);
        /* change this value! */
        stroke-linecap: round;
      }

      /* ---------- Draw animation (forward only) ---------- */
      @keyframes draw {
        from {
          stroke-dashoffset: var(--len);
        }

        to {
          stroke-dashoffset: 0;
        }
      }

      .anim-path.draw {
        animation: draw 0.5s linear forwards;
      }

      svg {
        width: 100%;
        height: 100%;
      }
    </style>
    <link rel="stylesheet" href="../assets/style.css" />
